import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD APPLICATION</h1>
      <div className="form">
        <label htmlFor="movieName">Movie Name</label>
        <input type="text" name="movieName" id="movieName" />
        <label htmlFor="review">Review</label>
        <input type="text" name="review" id="review" />
      </div>
    </div>
  );
}

export default App;
